import React, { Component } from 'react'
import { Route,Switch } from 'react-router-dom'
import Roomlist from '../RoomManagement/Roomlist/Roomlist'
import RoomSearchList from '../RoomManagement/RoomSearchList/RoomSearchList'
import StudentSearchList from '../StudentMagement/StudentSearchList/StudentSearchList'
import StudentList from '../StudentMagement/StudentList/StudentList'
import './RightBlock.scss'

import SearchBlock from '../SerachBlock/SerachBlock'
export default class RightBlock extends Component {
    render() {
        return (
            <div className='RightBlockContainer'>
                <SearchBlock/>
             <Switch>
                <Route path="/Domitory1/Room" component ={Roomlist}></Route>
                {/* <Route path="/Domitory2/Room" component ={Roomlist}></Route>
                <Route path="/Domitory3/Room" component ={Roomlist}></Route> */}
                <Route path="/Domitory1/Student" component ={StudentList}></Route>
                {/* <Route path="/Domitory2/Student" component ={StudentList}></Route>
                <Route path="/Domitory2/Student" component ={StudentList}></Route> */}


             </Switch>
              
                <Roomlist/>
                {/* <RoomSearchList/> */}
                {/* <StudentSearchList/> */}
                {/* <StudentList/> */}
            </div>
        )
    }
}
